cmd-welcome-help:
Создает сообщение которое будет отправленно на канал при подключении пользователя на сервер.
Если вы укажите url картинки в вашем сообщение, то ваша ссылка будет автоматически скрыта.
В ваших сообщениях вы можете использовать эти команды :

@name : Имя пользователя
@mention : Упоминание пользователя
@serv : Имя сервера
@id : ID пользователя
@number : Номер пользователя на сервере

cmd-goodbye-help:
Создает сообщение которое будет отправленно на канал при отключении пользователя от сервера.
Если вы укажите url картинки в вашем сообщение, то ваша ссылка будет автоматически скрыта.
В ваших сообщениях вы можете использовать эти команды :

@name : Имя пользователя
@mention : Упоминание пользователя
@serv : Имя сервера
@id : ID пользователя
@number : Номер пользователя на сервере
